    func getPointSet(thisSetType: PointSetType) -> [Point]{
        
        self.PointSet = thisSetType
        print("this herb set I am trying to load is \(PointSet)")
        switch thisSetType {
            
        case .Lung                  : return Lung()
        case .LargeIntestine        : return LargeIntestine()
